### YamlMime:TSEnum
name: ConnectorSet
uid: azure-maps-rest.atlas.service.Models.ConnectorSet
package: azure-maps-rest
summary: >-
  Defines values for ConnectorSet.

  Possible values include: 'StandardHouseholdCountrySpecific', 'IEC62196Type1',

  'IEC62196Type1CCS', 'IEC62196Type2CableAttached', 'IEC62196Type2Outlet',
  'IEC62196Type2CCS',

  'IEC62196Type3', 'Chademo', 'IEC60309AC1PhaseBlue', 'IEC60309DCWhite', 'Tesla'
fullName: ConnectorSet
isPreview: false
isDeprecated: false
fields:
  - name: Chademo
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.Chademo
    package: azure-maps-rest
    summary: >-
      CHAdeMO connector named after an association formed by the Tokyo Electric
      Power Company and

      industrial partners. Because of this is is also known as the TEPCO's
      connector. It supports

      fast DC charging.
  - name: IEC60309AC1PhaseBlue
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.IEC60309AC1PhaseBlue
    package: azure-maps-rest
    summary: >-
      Industrial Blue connector is a connector defined in the IEC 60309
      standard. It is sometime

      referred to as by some combination of the standard, the color and the fact
      that is a single

      phase connector. The connector usually has the "P+N+E, 6h" configuration.
  - name: IEC60309DCWhite
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.IEC60309DCWhite
    package: azure-maps-rest
    summary: >-
      Industrial White connector is a DC connector defined in the IEC 60309
      standard.
  - name: IEC62196Type1
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.IEC62196Type1
    package: azure-maps-rest
    summary: >-
      Type 1 connector as defined in the IEC 62196-2 standard. Also called
      Yazaki after the original

      manufacturer or SAE J1772 after the standard that first published it.
      Mostly used in

      combination with 120V single phase or up to 240V single phase
      infrastructure.
  - name: IEC62196Type1CCS
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.IEC62196Type1CCS
    package: azure-maps-rest
    summary: >-
      Type 1 based combo connector as defined in the IEC 62196-3 standard. The
      connector is based on

      the Type 1 connector – as defined in the IEC 62196-2 standard – with two
      additional direct

      current (DC) contacts to allow DC fast charging.
  - name: IEC62196Type2CCS
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.IEC62196Type2CCS
    package: azure-maps-rest
    summary: >-
      Type 2 based combo connector as defined in the IEC 62196-3 standard. The
      connector is based on

      the Type 2 connector – as defined in the IEC 62196-2 standard – with two
      additional direct

      current (DC) contacts to allow DC fast charging.
  - name: IEC62196Type2CableAttached
    uid: >-
      azure-maps-rest.atlas.service.Models.ConnectorSet.IEC62196Type2CableAttached
    package: azure-maps-rest
    summary: >-
      Type 2 connector as defined in the IEC 62196-2 standard. Provided as a
      cable and plug attached

      to the charging point
  - name: IEC62196Type2Outlet
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.IEC62196Type2Outlet
    package: azure-maps-rest
    summary: >-
      Type 2 connector as defined in the IEC 62196-2 standard. Provided as a
      socket set into the

      charging point.
  - name: IEC62196Type3
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.IEC62196Type3
    package: azure-maps-rest
    summary: >-
      Type 3 connector as defined in the IEC 62196-2 standard. Also called Scame
      after the original

      manufacturer. Mostly used in combination with up to 240V single phase or
      up to 420V three

      phase infrastructure.
  - name: StandardHouseholdCountrySpecific
    uid: >-
      azure-maps-rest.atlas.service.Models.ConnectorSet.StandardHouseholdCountrySpecific
    package: azure-maps-rest
    summary: >
      These are the standard household connectors for a certain region. They are
      all AC single phase

      and the standard Voltage and standard Amperage.

      See also: [Plug & socket types - World

      Standards](https://www.worldstandards.eu/electricity/plugs-and-sockets)
  - name: Tesla
    uid: azure-maps-rest.atlas.service.Models.ConnectorSet.Tesla
    package: azure-maps-rest
    summary: >-
      The Tesla connector is the regionally specific Tesla Supercharger
      connector. I.e. it refers to

      either Tesla's proprietary connector, sometimes referred to as Tesla Port
      mostly limited to

      North America or the modified Type 2 (DC over Type 2) in Europe.
